import React from 'react';

function ChatHistory() {
    const [messages, setMessages] = useState([
        { sender: 'user', text: "What's the crime rate in LA this week?" },
        { sender: 'bot', text: "The crime rate in LA has decreased by 10% this week." },
        // More messages can be added dynamically here
      ]);

  return (
    <div className="chat-history">
      <h2>Chat History</h2>
      <div className="chat-history-items">
        {/* Add dynamic chat history items here */}
        <p><strong>John Doe:</strong> What's the crime rate in LA this week?</p>
        <p><strong>Bot:</strong> The crime rate in LA has decreased by 10% this week.</p>
        {/* More history items */}
      </div>
    </div>
  );
}

export default ChatHistory;
